import React from "react";
import {UserContext, EmailContext} from "../../App"


function ComponentF() {
    return (
        <div>
            <UserContext.Consumer>
                <EmailContext.Consumer>
                    {
                        (username, email) => (
                            <h1>My name is {username}, and my email is {e}.</h1>

                        )
                    }
                </EmailContext.Consumer>

            </UserContext.Consumer>
            
        </div>
    )
}

export default ComponentF
